import 'bootstrap/dist/css/bootstrap.min.css';
import Header from './Mycomponents/Header';
import Body from './Mycomponents/Body';
import { BrowserRouter, Route, Switch, Redirect } from 'react-router-dom';
import TestComponent from './Mycomponents/Test';
import TestComponentNew from './Mycomponents/ExampleComponent';
import Upcoming from './Mycomponents/Upcoming';
import Toprated from './Mycomponents/Toprated'

// Component for displaying a 404 message
const NotFound = () => {
  return <h1>404 - Not Found</h1>;
};

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Header />
        <Switch>
          <Route path="/test" component={TestComponent} />
          <Route path="/testnew" component={TestComponentNew} />
          <Route path="/home" component={Body} />
          <Route path="/upcoming" component={Upcoming} />
          <Route path="/top-rated" component={Upcoming} />
          {/* Redirect the root ("/") to "/home" */}
          <Redirect from="/" to="/home" />
          {/* Route for handling 404 */}
          <Route component={NotFound} />
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
